// src/modules/NotFoundPage/NotFoundPage.tsx
import React from 'react';

const NotFoundPage = () => {
  return (
    <div>
      <h1>404 - Сторінку не знайдено</h1>
      <p>Такої сторінки не існує.</p>
    </div>
  );
};

export default NotFoundPage;
